class AddHabitForm extends React.Component {
    render() {
        return (
            <form>
                <input name="habit" type="text" placeholder="Habit"/>
                <input name="timeFrameNumber" type="number" placeholder="Number of Times"/>
                <select name="timeFrameLength">
                </select>
                <select name="habitCategory">
                </select>
            </form>
        )

    }
}

export default AddHabitForm;
